import React from 'react'

const Section2 = () => {
    return (
        <div className='h-96 bg-black my-2 '>
            <div className='flex justify-around'>
                <div>
                    <h1>Enjoy on your TV</h1>
                </div>
            </div>
        </div>
    )
}

export default Section2
